import numpy as np
import copy

def get_map_(index):
    map_ = np.array([[ -1,  -1,  -1],
                     [ -1,  -1,  -1],
                     [ -1,  -1,  -1]])
    b = ''
    while index > 0:
        b = b+str(index % 3)
        index = index // 3
    b = b+(9-len(b))*'0'
    for i in range(3):
        for j in range(3):
            map_[j, i] = int(b[j+i*3]) - 1

    return map_


def get_index(map_):
    k = 0
    num = 0
    for i in range(3):
        for j in range(3):
            num += (map_[j, i]+1)*(3**k)
            k += 1
    return num


